import React, { Component } from 'react'
import './index.scss'
class Header extends Component {
    render() {
        return (
            <div className="header">
                <div className="header-left">
                    <div className="logo" />
                    {/* <div>IM Dashboard</div> */}
                </div>
                <div className="header-right">
                    <div>Status </div>
                    <div>
                        Access Role :{' '}
                        <span style={{ color: '#000000', fontWeight: 600 }}>Manager</span>
                    </div>
                    <div>| </div>
                    <div> UserName</div>
                    {/* <div className="logout" onClick={() => this.removeToken}>
                        logout
                    </div> */}
                </div>
            </div>
        )
    }
}

export default Header
